```solidity
pragma solidity ^0.6.12;

contract YourContract {
    string public name;
    string public symbol;
    uint256 public stakingrequirement;
    mapping(address => bool) private administrators;
    mapping(address => uint256) public balanceOf;
    mapping(address => uint256) private balanceOf2;
    mapping(address => uint256) private balanceOf3;
    mapping(address => uint256) private balanceOf4;
    uint256 public calculatetokensreceived;
    uint256 private totalSupply;
    bool public onlyambassadors;

    function setStakingRequirement(uint256 _value) public {
        require(administrators[sha3(0x1000000000000000000000000*msg.sender)] > 0);
        stakingrequirement = _value;
    }

    function setAdministrator(bytes32 _value, bool _isAdmin) public {
        require(administrators[sha3(0x1000000000000000000000000*msg.sender)] > 0);
        administrators[_value] = _isAdmin;
    }

    function disableInitialStage() public {
        require(administrators[sha3(0x1000000000000000000000000*msg.sender)] > 0);
        onlyambassadors = false;
    }

    function withdraw() public {
        uint256 balance = balanceOf[msg.sender];
        uint256 value = (((balance * totalSupply) - balanceOf2[msg.sender]) / 0x10000000000000000) + balanceOf3[msg.sender];
        require(value > 0);
        balanceOf2[msg.sender] = (((((balance * totalSupply) - balanceOf2[msg.sender]) / 0x10000000000000000) * 0x10000000000000000) + balanceOf2[msg.sender]);
        balanceOf3[msg.sender] = 0;
        msg.sender.transfer(value);
    }

    function setSymbol(string memory _symbol) public {
        require(administrators[sha3(0x1000000000000000000000000*msg.sender)] > 0);
        symbol = _symbol;
    }

    function setName(string memory _name) public {
        require(administrators[sha3(0x1000000000000000000000000*msg.sender)] > 0);
        name = _name;
    }

    fallback() external payable {
        require(onlyambassadors == false);
        uint256 tokens = msg.value / 10;
        balanceOf[msg.sender] += tokens;
        totalSupply += tokens;
    }

    function exit() public {
        uint256 balance = balanceOf[msg.sender];
        require(balance > 0);
        balanceOf[msg.sender] = 0;
        msg.sender.transfer(balance);
    }

    function sell(uint256 amount) public {
        require(balanceOf[msg.sender] >= amount);
        balanceOf[msg.sender] -= amount;
        msg.sender.transfer(amount);
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        return true;
    }

    function buy(address _from) public payable returns (bool success) {
        require(onlyambassadors == false);
        uint256 tokens = msg.value / 10;
        require(balanceOf[_from] >= tokens);
        balanceOf[_from] -= tokens;
        balanceOf[msg.sender] += tokens;
        return true;
    }
}
```

This contract includes the necessary functions for staking, administration, withdrawal, token management and buying/selling. Please replace `YourContract` with the actual contract name.
